--
-- Name: view_results; Type: VIEW; Schema: public; Owner: nicola
--

CREATE VIEW public.view_results AS
 SELECT u.url,
    lower(u.role) AS role,
    (sum(u.retrieved))::numeric(4,3) AS n_detection,
    (sum(u.result))::numeric(4,3) AS n_correct,
    (sum(u.correct_block))::numeric(4,3) AS n_all_correct
   FROM ( SELECT DISTINCT ON (gb.url, gb.role) gb.url,
            gb.role,
            gb.block AS gt_block,
            e.block AS tool_block,
            area(gb.block) AS gt_block_area,
            area(e.block) AS tool_block_area,
            area((gb.block # e.block)) AS intersection_area,
                CASE
                    WHEN (area(gb.block) > (0)::double precision) THEN (area((gb.block # e.block)) / area(gb.block))
                    ELSE (0)::double precision
                END AS intersection_area_ratio,
                CASE
                    WHEN ((area(gb.block) > (0)::double precision) AND ((area((gb.block # e.block)) / area(gb.block)) > (0.85)::double precision)) THEN 1
                    ELSE 0
                END AS result,
                CASE
                    WHEN (e.block IS NOT NULL) THEN 1
                    ELSE 0
                END AS retrieved,
                CASE
                    WHEN (gb.block IS NOT NULL) THEN 1
                    ELSE 0
                END AS correct_block
           FROM ((public.evaluations e1
             LEFT JOIN public.gt_blocks gb ON ((e1.url = gb.url)))
             LEFT JOIN public.evaluations e ON (((gb.url = e.url) AND (gb.role = e.role))))
          ORDER BY gb.url, gb.role) u
  GROUP BY u.url, u.role;


ALTER TABLE public.view_results OWNER TO nicola;

